import React, { useState } from "react";
import axios from "axios";
import "./Prescription.css";

const PrescriptionForm = () => {
  const [formData, setFormData] = useState({
    patientId: "",
    doctorId: "",
    validUntil: "",
    notes: "",
    medicines: [],
  });

  const [medicine, setMedicine] = useState({
    medicineName: "",
    dosage: "",
    quantity: "",
    frequency: "",
    instructions: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleMedicineChange = (e) => {
    const { name, value } = e.target;
    setMedicine({ ...medicine, [name]: value });
  };

  const addMedicine = () => {
    if (
      medicine.medicineName &&
      medicine.dosage &&
      medicine.quantity &&
      medicine.frequency &&
      medicine.instructions
    ) {
      setFormData({ ...formData, medicines: [...formData.medicines, medicine] });
      setMedicine({
        medicineName: "",
        dosage: "",
        quantity: "",
        frequency: "",
        instructions: "",
      });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("/api/prescriptions", formData);
      alert("Prescription created successfully!");
      console.log(response.data);
    } catch (error) {
      console.error("Error creating prescription:", error);
      alert("Failed to create prescription.");
    }
  };

  return (
    <div className="container">
      <div className="prescription-card">
        <h2>Create Prescription</h2>
        <form onSubmit={handleSubmit}>
          <label>Patient ID:</label>
          <input type="text" name="patientId" value={formData.patientId} onChange={handleChange} required />

          <label>Doctor ID:</label>
          <input type="text" name="doctorId" value={formData.doctorId} onChange={handleChange} required />

          <label>Valid Until:</label>
          <input type="date" name="validUntil" value={formData.validUntil} onChange={handleChange} required />

          <label>Notes:</label>
          <textarea name="notes" value={formData.notes} onChange={handleChange} required />

          <h3>Medicines</h3>
          <label>Medicine Name:</label>
          <input type="text" name="medicineName" value={medicine.medicineName} onChange={handleMedicineChange} required />

          <label>Dosage:</label>
          <input type="text" name="dosage" value={medicine.dosage} onChange={handleMedicineChange} required />

          <label>Quantity:</label>
          <input type="number" name="quantity" value={medicine.quantity} onChange={handleMedicineChange} required />

          <label>Frequency:</label>
          <input type="text" name="frequency" value={medicine.frequency} onChange={handleMedicineChange} required />

          <label>Instructions:</label>
          <textarea name="instructions" value={medicine.instructions} onChange={handleMedicineChange} required />

          <button type="button" onClick={addMedicine}>Add Medicine</button>

          <ul>
            {formData.medicines.map((med, index) => (
              <li key={index}>
                {med.medicineName} - {med.dosage}, {med.frequency}
              </li>
            ))}
          </ul>

          <button type="submit">Create Prescription</button>
        </form>
      </div>
    </div>
  );
};

export default PrescriptionForm;
